/*Table structure for table `srampos_companies_postpaid_bills` */

DROP TABLE IF EXISTS `srampos_companies_postpaid_bills`;

CREATE TABLE `srampos_companies_postpaid_bills` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `bill_id` int(11) NOT NULL,
  `payment_id` tinyint(4) NOT NULL,
  `company_id` int(11) NOT NULL,
  `credit_amount` decimal(25,6) NOT NULL,
  `due_date` datetime NOT NULL,
  `paid_on` datetime NOT NULL,
  `status` int(11) NOT NULL COMMENT '9-not paid,2-paid',
  `created_on` datetime NOT NULL,
  `amount_paid` decimal(25,6) NOT NULL,
  `amount_payable` decimal(25,6) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `srampos_companies_postpaid_bills` */

/*Table structure for table `srampos_costing` */

DROP TABLE IF EXISTS `srampos_costing`;

CREATE TABLE `srampos_costing` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date` date NOT NULL,
  `product_id` int(11) DEFAULT NULL,
  `sale_item_id` int(11) NOT NULL,
  `sale_id` int(11) DEFAULT NULL,
  `purchase_item_id` int(11) DEFAULT NULL,
  `quantity` decimal(15,6) NOT NULL,
  `purchase_net_unit_cost` decimal(25,6) DEFAULT NULL,
  `purchase_unit_cost` decimal(25,6) DEFAULT NULL,
  `sale_net_unit_price` decimal(25,6) NOT NULL,
  `sale_unit_price` decimal(25,6) NOT NULL,
  `quantity_balance` decimal(15,6) DEFAULT NULL,
  `inventory` tinyint(1) DEFAULT '0',
  `overselling` tinyint(1) DEFAULT '0',
  `option_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `srampos_costing` */

/*Table structure for table `srampos_currencies` */

DROP TABLE IF EXISTS `srampos_currencies`;

CREATE TABLE `srampos_currencies` (
