/*Table structure for table `srampos_loyalty` */

DROP TABLE IF EXISTS `srampos_loyalty`;

CREATE TABLE `srampos_loyalty` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `customer_id` bigint(20) NOT NULL,
  `name` varchar(255) NOT NULL,
  `phone` varchar(255) NOT NULL,
  `birthday` date NOT NULL,
  `loyalty_type` tinyint(4) NOT NULL COMMENT '0-Non VIP, 1-VIP',
  `register_date` date NOT NULL,
  `expriy_date` date NOT NULL,
  `total_points` bigint(20) NOT NULL,
  `amount` decimal(26,6) NOT NULL DEFAULT '0.000000',
  `loyalty_card` varchar(255) NOT NULL,
  `start_amount` decimal(25,6) NOT NULL DEFAULT '0.000000',
  `end_amount` decimal(25,6) NOT NULL DEFAULT '0.000000',
  `status` tinyint(4) NOT NULL,
  `create_on` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `srampos_loyalty` */

/*Table structure for table `srampos_loyalty_accumalation` */

DROP TABLE IF EXISTS `srampos_loyalty_accumalation`;

CREATE TABLE `srampos_loyalty_accumalation` (
  `id` tinyint(4) NOT NULL AUTO_INCREMENT,
  `loyalty_id` tinyint(4) NOT NULL,
  `accumulation_name` varchar(100) NOT NULL,
  `start_amount` decimal(25,4) NOT NULL,
  `end_amount` decimal(25,4) NOT NULL,
  `per_amounts` decimal(25,4) NOT NULL,
  `per_points` decimal(25,0) NOT NULL,
  `created_on` datetime NOT NULL,
  `created_id` tinyint(1) NOT NULL,
  `updated_on` datetime NOT NULL,
  `updated_id` tinyint(1) NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `srampos_loyalty_accumalation` */

