/*Table structure for table `srampos_material_request` */

DROP TABLE IF EXISTS `srampos_material_request`;

CREATE TABLE `srampos_material_request` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `material_request_no` varchar(55) NOT NULL,
  `warehouse_id` int(11) DEFAULT NULL,
  `to_warehouse_id` int(11) NOT NULL,
  `biller_id` int(11) NOT NULL,
  `biller` varchar(55) NOT NULL,
  `note` varchar(1000) DEFAULT NULL,
  `internal_note` varchar(1000) DEFAULT NULL,
  `total` decimal(25,6) NOT NULL,
  `product_discount` decimal(25,6) DEFAULT '0.000000',
  `order_discount` decimal(25,6) DEFAULT NULL,
  `order_discount_id` varchar(20) DEFAULT NULL,
  `total_discount` decimal(25,6) DEFAULT '0.000000',
  `product_tax` decimal(25,6) DEFAULT '0.000000',
  `order_tax_id` int(11) DEFAULT NULL,
  `order_tax` decimal(25,6) DEFAULT NULL,
  `total_tax` decimal(25,6) DEFAULT NULL,
  `shipping` decimal(25,6) DEFAULT '0.000000',
  `grand_total` decimal(25,6) NOT NULL,
  `status` varchar(20) DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `attachment` varchar(55) DEFAULT NULL,
  `hash` varchar(255) DEFAULT NULL,
  `cgst` decimal(25,6) DEFAULT NULL,
  `sgst` decimal(25,6) DEFAULT NULL,
  `igst` decimal(25,6) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

