/*Table structure for table `srampos_shift_time` */

DROP TABLE IF EXISTS `srampos_shift_time`;

CREATE TABLE `srampos_shift_time` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  `start_time` time NOT NULL,
  `end_time` time NOT NULL,
  `created_on` datetime NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `srampos_shift_time` */

/*Table structure for table `srampos_skrill` */

DROP TABLE IF EXISTS `srampos_skrill`;

CREATE TABLE `srampos_skrill` (
  `id` int(11) NOT NULL,
  `active` tinyint(4) NOT NULL,
  `account_email` varchar(255) NOT NULL DEFAULT 'testaccount2@moneybookers.com',
  `secret_word` varchar(20) NOT NULL DEFAULT 'mbtest',
  `skrill_currency` varchar(3) NOT NULL DEFAULT 'USD',
  `fixed_charges` decimal(25,6) NOT NULL DEFAULT '0.000000',
  `extra_charges_my` decimal(25,6) NOT NULL DEFAULT '0.000000',
  `extra_charges_other` decimal(25,6) NOT NULL DEFAULT '0.000000',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `srampos_skrill` */

/*Table structure for table `srampos_stock_count_items` */

DROP TABLE IF EXISTS `srampos_stock_count_items`;

CREATE TABLE `srampos_stock_count_items` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `stock_count_id` int(11) NOT NULL,
  `product_id` int(11) NOT NULL,
  `product_code` varchar(50) DEFAULT NULL,
  `product_name` varchar(255) DEFAULT NULL,
  `product_variant` varchar(55) DEFAULT NULL,
  `product_variant_id` int(11) DEFAULT NULL,
  `expected` decimal(15,6) NOT NULL,
  `variant` bigint(10) NOT NULL,
  `counted` decimal(15,6) NOT NULL,
  `cost` decimal(25,6) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `stock_count_id` (`stock_count_id`),
  KEY `product_id` (`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `srampos_stock_count_items` */

/*Table structure for table `srampos_stock_counts` */

DROP TABLE IF EXISTS `srampos_stock_counts`;

CREATE TABLE `srampos_stock_counts` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `reference_no` varchar(55) NOT NULL,
  `warehouse_id` int(11) NOT NULL,
  `type` varchar(10) NOT NULL,
  `initial_file` varchar(50) NOT NULL,
  `final_file` varchar(50) DEFAULT NULL,
  `brands` varchar(50) DEFAULT NULL,
  `brand_names` varchar(100) DEFAULT NULL,
  `categories` varchar(50) DEFAULT NULL,
  `category_names` varchar(100) DEFAULT NULL,
  `note` text,
  `products` int(11) DEFAULT NULL,
  `rows` int(11) DEFAULT NULL,
  `differences` int(11) DEFAULT NULL,
  `matches` int(11) DEFAULT NULL,
  `missing` int(11) DEFAULT NULL,
  `created_by` int(11) NOT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `finalized` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `warehouse_id` (`warehouse_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `srampos_stock_counts` */

/*Table structure for table `srampos_suspended_bills` */

DROP TABLE IF EXISTS `srampos_suspended_bills`;

CREATE TABLE `srampos_suspended_bills` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `customer_id` int(11) NOT NULL,
  `customer` varchar(55) DEFAULT NULL,
  `count` int(11) NOT NULL,
  `order_discount_id` varchar(20) DEFAULT NULL,
  `order_tax_id` int(11) DEFAULT NULL,
  `total` decimal(25,6) NOT NULL,
  `biller_id` int(11) DEFAULT NULL,
  `warehouse_id` int(11) DEFAULT NULL,
  `created_by` int(11) NOT NULL,
  `suspend_note` varchar(255) DEFAULT NULL,
  `shipping` decimal(15,6) DEFAULT '0.000000',
  `cgst` decimal(25,6) DEFAULT NULL,
  `sgst` decimal(25,6) DEFAULT NULL,
  `igst` decimal(25,6) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `srampos_suspended_bills` */

/*Table structure for table `srampos_suspended_items` */

DROP TABLE IF EXISTS `srampos_suspended_items`;

CREATE TABLE `srampos_suspended_items` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `suspend_id` int(11) unsigned NOT NULL,
  `recipe_id` int(11) unsigned NOT NULL,
  `recipe_code` varchar(55) NOT NULL,
  `recipe_name` varchar(255) NOT NULL,
  `recipe_type` varchar(20) NOT NULL,
  `kitchen_type_id` tinyint(4) NOT NULL,
  `net_unit_price` decimal(25,6) NOT NULL,
  `unit_price` decimal(25,6) NOT NULL,
  `quantity` decimal(15,6) DEFAULT '0.000000',
  `warehouse_id` int(11) DEFAULT NULL,
  `item_tax` decimal(25,6) DEFAULT NULL,
  `tax_rate_id` int(11) DEFAULT NULL,
  `tax` varchar(55) DEFAULT NULL,
  `discount` varchar(55) DEFAULT NULL,
  `item_discount` decimal(25,6) DEFAULT NULL,
  `subtotal` decimal(25,6) NOT NULL,
  `serial_no` varchar(255) DEFAULT NULL,
  `option_id` int(11) DEFAULT NULL,
  `addon_id` varchar(250) NOT NULL,
  `product_type` varchar(20) DEFAULT NULL,
  `real_unit_price` decimal(25,6) DEFAULT NULL,
  `recipe_unit_id` int(11) DEFAULT NULL,
  `recipe_unit_code` varchar(10) DEFAULT NULL,
  `unit_quantity` decimal(15,6) NOT NULL,
  `comment` varchar(255) DEFAULT NULL,
  `gst` varchar(20) DEFAULT NULL,
  `cgst` decimal(25,6) DEFAULT NULL,
  `sgst` decimal(25,6) DEFAULT NULL,
  `igst` decimal(25,6) DEFAULT NULL,
  `recipe_variant_id` tinyint(4) NOT NULL,
  `variant` varchar(200) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

