/*Table structure for table `srampos_transfer_items` */

DROP TABLE IF EXISTS `srampos_transfer_items`;

CREATE TABLE `srampos_transfer_items` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `transfer_id` int(11) NOT NULL,
  `product_id` int(11) NOT NULL,
  `product_code` varchar(55) NOT NULL,
  `product_name` varchar(255) NOT NULL,
  `option_id` int(11) DEFAULT NULL,
  `expiry` date DEFAULT NULL,
  `quantity` decimal(15,6) NOT NULL,
  `tax_rate_id` int(11) DEFAULT NULL,
  `tax` varchar(55) DEFAULT NULL,
  `item_tax` decimal(25,6) DEFAULT NULL,
  `net_unit_cost` decimal(25,6) DEFAULT NULL,
  `subtotal` decimal(25,6) DEFAULT NULL,
  `quantity_balance` decimal(15,6) NOT NULL,
  `unit_cost` decimal(25,6) DEFAULT NULL,
  `real_unit_cost` decimal(25,6) DEFAULT NULL,
  `date` date DEFAULT NULL,
  `warehouse_id` int(11) DEFAULT NULL,
  `product_unit_id` int(11) DEFAULT NULL,
  `product_unit_code` varchar(10) DEFAULT NULL,
  `unit_quantity` decimal(15,6) NOT NULL,
  `gst` varchar(20) DEFAULT NULL,
  `cgst` decimal(25,6) DEFAULT NULL,
  `sgst` decimal(25,6) DEFAULT NULL,
  `igst` decimal(25,6) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `transfer_id` (`transfer_id`),
  KEY `product_id` (`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `srampos_transfer_items` */

/*Table structure for table `srampos_transfers` */

DROP TABLE IF EXISTS `srampos_transfers`;

CREATE TABLE `srampos_transfers` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `transfer_no` varchar(55) NOT NULL,
  `material_request_id` tinyint(10) NOT NULL,
  `date` datetime NOT NULL,
  `from_warehouse_id` int(11) NOT NULL,
  `from_warehouse_code` varchar(55) NOT NULL,
  `from_warehouse_name` varchar(55) NOT NULL,
  `to_warehouse_id` int(11) NOT NULL,
  `to_warehouse_code` varchar(55) NOT NULL,
  `to_warehouse_name` varchar(55) NOT NULL,
  `note` varchar(1000) DEFAULT NULL,
  `total` decimal(25,6) DEFAULT NULL,
  `total_tax` decimal(25,6) DEFAULT NULL,
  `grand_total` decimal(25,6) DEFAULT NULL,
  `created_by` varchar(255) DEFAULT NULL,
  `status` varchar(55) NOT NULL DEFAULT 'pending',
  `shipping` decimal(25,6) NOT NULL DEFAULT '0.000000',
  `attachment` varchar(55) DEFAULT NULL,
  `cgst` decimal(25,6) DEFAULT NULL,
  `sgst` decimal(25,6) DEFAULT NULL,
  `igst` decimal(25,6) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `srampos_transfers` */

